import React from 'react'

export default function Navbar() {
    const styles = {
        container: {
            display: 'flex',
        }};

    return (
        <div className="navbar" style={styles.container}>
            <div className="logo">  
            <img 
                src="https://bcassetcdn.com/public/blog/wp-content/uploads/2019/07/18094633/consulting.png" 
                style={{ height: "70px", marginTop: "10px", marginLeft: "10px" }}
                alt=""
            />
            </div>
            <div className="searchbar" style={{display: "row", justifyContent: "center"}}> 
                <form className="searchform" style={{height: "30px", marginTop: "30px", marginLeft: "400px"}} >
                    <input className="searchbar" type="search" placeholder="Search here..." />
                    <button className="searchbutton" type="submit" 
                        style={{backgroundColor: "red", borderRadius: "90px", padding: "8px", 
                        marginLeft: "6px", fontFamily: "Arial", fontSize: "12px"}}> SEARCH </button>
                </form>

            </div> 
        </div>
    );
}
